import React, {useState} from "react";

function TodoItem(props){
    const [userClicked, setUserClick] = useState(false)
    
    return (
        <div onClick="setUserClick">
            <li style={{textDecoration:"line-through"}}>{props.todoItem}</li>)
        </div>
    )
}

export default TodoItem;
